import React, {Component} from 'react';

class NavAuth extends Component {
  render() {
    return (
        <nav>
          <ul>
            <p>
            <a class="btn btn-outline-info" href="/AuthForm">Вход</a>
            </p>
            <p>
            <a class="btn btn-outline-info" href="/RegisterForm">Регистрация</a>
            </p>
          </ul>
        </nav>
    );
  }
}

export default NavAuth;
